  const { logged, setLogged, blogs, setBlogs, write, setWrite } = BlogDetail();
  return (
    <SwipeableDrawer anchor={'bottom'} open={write} PaperProps onClose={() => { setWrite(false) }} onOpen={() => { setWrite(true) }}>

        <input />
        <textarea />
    </SwipeableDrawer>
  )
}

export default Write
